import React from 'react';
import './header.css';
import { Link } from 'react-router-dom'; // Import Link

function Header() {
  return (
    <header>
      <nav>
        <div className="nav-container"> {/* Add this container for flex */}
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/search">Room Search</Link></li>
            <li><Link to="/bookings">Bookings</Link></li>
            <li><Link to="/hotel-directory">Hotel Directory</Link></li>
            <li><Link to="/management">Management</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
          <Link to="/signup" className="signup-btn">Sign Up</Link> {/* Add this line for the Sign Up button */}
        </div>
      </nav>
    </header>
  );
}

export default Header;
